import png
import os
import pickle
import sys

assert sys.version.startswith('3.'), "Must use Python3, not %s!" % sys.version

def convert_image_to_script(fn_python, image, width=40):
    if os.path.exists(fn_python): return
    data = pickle.dumps(image)
    l = [data[i:i+width] for i in range(0, len(data), width)]
    l = str(l)[1:-1].split(', ')
    with open(fn_python, 'wt') as file:
        file.write('import pickle\n')
        file.write('\n')
        file.write('image = pickle.loads(\n')
        file.write(' +\n'.join(['    ' + o for o in l]))
        file.write('\n')
        file.write('    )\n')

